import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { IndexComponent } from './System/index/index.component';
import { TLPComponent } from './System/tlp/tlp.component';
import { TDPComponent } from './System/tdp/tdp.component';
import { TepComponent } from './System/tep/tep.component';

@NgModule({
  declarations: [
    AppComponent,
    IndexComponent,
    TLPComponent,
    TDPComponent,
    TepComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
